            @ChangeSuckMode.started += instance.OnChangeSuckMode;
            @ChangeSuckMode.performed += instance.OnChangeSuckMode;
            @ChangeSuckMode.canceled += instance.OnChangeSuckMode;
            @ExitMiniGame.started += instance.OnExitMiniGame;
            @ExitMiniGame.performed += instance.OnExitMiniGame;
            @ExitMiniGame.canceled += instance.OnExitMiniGame;
        }

        private void UnregisterCallbacks(IPlayerActions instance)
        {
            @Move.started -= instance.OnMove;
            @Move.performed -= instance.OnMove;
            @Move.canceled -= instance.OnMove;
            @Turn.started -= instance.OnTurn;
            @Turn.performed -= instance.OnTurn;
            @Turn.canceled -= instance.OnTurn;
            @OnLookUpDown.started -= instance.OnOnLookUpDown;
            @OnLookUpDown.performed -= instance.OnOnLookUpDown;
            @OnLookUpDown.canceled -= instance.OnOnLookUpDown;
            @Interact.started -= instance.OnInteract;
            @Interact.performed -= instance.OnInteract;
            @Interact.canceled -= instance.OnInteract;
            @Jump.started -= instance.OnJump;
            @Jump.performed -= instance.OnJump;
            @Jump.canceled -= instance.OnJump;
            @Suck.started -= instance.OnSuck;
            @Suck.performed -= instance.OnSuck;
            @Suck.canceled -= instance.OnSuck;
            @MinigameTest.started -= instance.OnMinigameTest;
            @MinigameTest.performed -= instance.OnMinigameTest;
            @MinigameTest.canceled -= instance.OnMinigameTest;
            @Sprint.started -= instance.OnSprint;
            @Sprint.performed -= instance.OnSprint;
            @Sprint.canceled -= instance.OnSprint;
            @ChangeSuckMode.started -= instance.OnChangeSuckMode;
            @ChangeSuckMode.performed -= instance.OnChangeSuckMode;
            @ChangeSuckMode.canceled -= instance.OnChangeSuckMode;
            @ExitMiniGame.started -= instance.OnExitMiniGame;
            @ExitMiniGame.performed -= instance.OnExitMiniGame;
            @ExitMiniGame.canceled -= instance.OnExitMiniGame;
        }

        public void RemoveCallbacks(IPlayerActions instance)
        {
            if (m_Wrapper.m_PlayerActionsCallbackInterfaces.Remove(instance))
                UnregisterCallbacks(instance);
        }

        public void SetCallbacks(IPlayerActions instance)
        {
            foreach (var item in m_Wrapper.m_PlayerActionsCallbackInterfaces)
                UnregisterCallbacks(item);
            m_Wrapper.m_PlayerActionsCallbackInterfaces.Clear();
            AddCallbacks(instance);
        }
